import React from 'react';
import ReactDOM from 'react-dom';

class StudentList extends React.Component {
    constructor(props) {
        super(props);
    }

    



    render() {
        return (
            <div>
                <p>Student Data{this.props.rowId}</p>       

                 <table className="wrapped confluenceTable tablesorter tablesorter-default">
                    <thead>
                        <tr className="tablesorter-headerRow">
                            <th>
                                Student Name
                        </th>
                            <th>
                                Age
                        </th>
                            <th>
                                GPA
                        </th>
                            <th>

                            </th>
                            <th>

                            </th>

                        </tr>
                    </thead>
                    <tbody>
                        {
                            list.map(el => (
                                <tr key={el.stuId}>

                                    <td>
                                        {el.stuFName} {el.stuLName}

                                    </td>
                                    <td>
                                        {el.stuAge}
                                    </td>
                                    <td>
                                        {el.stuGpa}
                                    </td>
                                    <td>
                                        edit
                                </td>
                                    <td>
                                        delete
                                </td>
                                </tr>
                            ))
                        }
                    </tbody>
                </table>
      


            </div>

            
        );

    }
}

export default StudentList;
